import React from 'react';
import ReactDOM from 'react-dom';


class NewResident extends React.Component {
  render() {
    return (
      <form classname="container" formtext-padding="10 px">
        <p>Resident Name:</p>
        <input
          type="text" margin="10 px"
        />
        <p>Move-In Date:</p>
        <input type="date" margin="10px"
        />
      </form>
    );
  }
}

export default NewResident;
